import React, { useEffect } from 'react';

const Accordion = () => {
    const lists = [];

    useEffect(async () => {
        const todos = await fetch('https://jsonplaceholder.typicode.com/todos').then(JSON.parse);
    });

    return (
        <ul>
            {lists.map((list, idx) => <li key={idx}>{list}</li>)}
        </ul>
    )
}

export { Accordion }
